    render(){
        return(
            <div class="seccionForm">
                <fieldset class="form-group">
                    <div class="row">
                        <legend class="col-form-label col-sm-2 pt-0">Objetivo</legend>
                        <div class="col-sm-10">
                            <OpcionRadio nombre='Maximizar'/>
                            <OpcionRadio nombre='Maximizar'/>
                            <OpcionRadio nombre='Maximizar'/>
                        </div>
                    </div>
                </fieldset>
          </div>
        );
    }
}

